import React from 'react'

import './components.css'

const BarMain = ({ items }) => {

  const result = items.map((item) => {
    return <li key={item.id}>{item.title}</li>
  })

  return (
    <div className='bar-main'>
      <ul>
        <li>الرئيـسيـة</li>
        {result}
      </ul>
    </div>
  )
}

export default BarMain
